column9:
Stephanie's machine is so sloow :( Too long for even simple steps (e.g deleting node_modules and npm install) that we were trying. Aside from the slowness, we were running into problems with mongoose.connect and a permissions error. We hit lunchtime without being able to resolve but had her attempt a machine reboot to see if it made a difference. She is submitting a new ticket after break.  
Yellow since environment issues is definitely slowing her down.
//UPDATE: She continued the googling during lunch break and tried a few other things -- one that solve her problem! Nice job, stephanye!
